import React from 'react';
import { Typography, Box } from '@mui/material';

const Allergies = () => {
    // Bu sayfanın kodunu bir sonraki adımda yazacağız
    return (
        <Box>
            <Typography variant="h5" gutterBottom>Alerjilerim</Typography>
            <Typography variant="body1">Lütfen alerjilerinizi seçin.</Typography>
        </Box>
    );
};

export default Allergies;
